<pre><code> ParseQuery&lt;ParseObject&gt; query = ParseQuery.getQuery("Posts");
  ArrayList&lt;String&gt; tags = (ArrayList&lt;String&gt;)object.get("myTags");
  query.whereContainedIn("tags", tags);
</code></pre>

<p>The problem with this query is that it brings very vague answers, for example, a user follows a "Curiosities" tag, and also follows the tag "Avengers", I want to show it first, posts that contain these 2 tags, not only one of them.</p>

