Sort Keys in Response Object from Mongoose in ExpressJS and NodeJS<p>I have been working on my own small API, so far everything works super fine, i just have a small cosmetic issue I can#t seem to find an answer to.</p>

<p>I defined a schema like so in mongoose:</p>

<pre><code>const ArtistSchema = new Schema({
stageName: {
    type: String,
    unique: true,
    required: true,
    minlength: 3,
    maxlength: 255
},
realName: {
    type: String,
    unique: true,
    required: true,
    minlength: 5,
    maxlength: 255
},
birthday: {
    type: Date,
    required: true
},
debutDate: {
    type: Date,
    required: true
},
company: {
    type: String,
    minlength: 5,
    maxlength: 255,
    required: function () {
        return this.active;
    }
},
active: {
    type: Boolean,
    default: true
},
music: [AlbumSchema],
createdAt: {
    type: Date,
    default: Date.now
}
});
</code></pre>

<p>I can create an entry in the database, with no problem either. I use this function on app.post</p>

<pre><code>    create(req, res, next) {
    const artistProps = req.body;
        Artist.create(artistProps)
            .then(artist =&gt; res.send(artist))
            .catch(next);
   },
</code></pre>

<p>This works good, but the res.send(artist)) actually returns the object with no key order.. or in a pattern I cannot recognize. I want the response to be the same sorting as i defined in the schema, beause now it returns it:</p>

<p>active, stagename, realname, label, music, birthday</p>

<p>while it should be stagename, realname, birthday, debutDate etc.. </p>

<p>I hope someone can help me out here. I know i can sort the VALUEs of a specific key with sort (like sort stageName alphabetically) but I really cant find anything for the keys .</p>

