Indexing into mongoose.model for an array is returning undefined<p>I've created a simple table (document?) in mongoDB.
I'm using Node and Mongoose to connect to it.</p>

<p>In my method, I am calling <code>model.find({})</code> to retrieve all records and then iterating over them to find one that I want (this is within a loop - I'm thinking it will be more efficient to hit the DB once, and then process in memory to avoid connecting to the database each time).</p>

<p>When I <code>console.log</code> the match, I'm getting the full object printed out.  When I print out one property, however, it's listing it as undefined.  This property is an array, and it's happening for another property that has an array that I added as a test.  What am I missing here?</p>

<p>Here's my code snippet:</p>

<pre><code> Documents.find({}).then(docsData =&gt; { // Documents is my model
      docs.entries.forEach(entry =&gt; { // docs.entries is the collection I want to match to
        const match = docsData.find(
          doc =&gt; doc['dropboxId'] == entry['id']
        );
        if (match) {

          entry['tags'] = match.tags;
          console.log('match tags', match.tags); // this prints out undefined
          console.log('match', match); // this prints out the object with tags
        }
</code></pre>

<p>Any ideas?</p>

