<p>Any ideas?</p>; Answer: I don't think there are any guarantees that a ternary operator in source code would never result in a branch. In general if-then-else sequences and ternary operators are treated quite similar by the compiler: in either case it will try to emit code that minimizes branching by use of predicated instructions or select-type instructions (the hardware equivalent of a ternary operator). In particular for tight local branching, you wouldn't want to worry about branch-free code (at least not until a profiler tells you there is a problem) as the compiler will typically take care of these things.

